import { string } from "prop-types";

type Actions = 
    | {type: 'openCollections', boolean: boolean} 

interface Collections {
    name: string;
}
type InitType = 
    {
    collections?: Collections[];
    current?: string;
    open?: boolean;
}

let initstate = {
    collections: [],
    current: 'ALL',
    open: false


}



export const collectionsReducer = (state: InitType , action:Actions) => {
    switch(action.type) {
        case "openCollections":
            return {...state, open: action.boolean}
        default:
            return state;
    }
}
